class Observer{constructor(){this.observer=[]}subscribe(r){this.observer.push(r)}unsubscribe(r){let s=this.observer.indexOf(r);this.observer.splice(s,1)}notify(r){for(var s in this.observer){var e=this.observer[s];"stop"==r?e.stop():"continue"==r?(e.start(),e.animateFrame()):"powerup"==r&&e.powerup()}}}